import React from "react";

export default function Footer() {
  return (
    <div className="footer card">
      <footer className="footer--container">
        <img src="../Images/Twitter_Icon.png" alt="description" />
        <img src="../Images/Facebook_Icon.png" alt="description" />
        <img src="../Images/GitHub_Icon.png" alt="description" />
        <img src="../Images/Instagram_Icon.png" alt="description" />
        <img src="../Images/Linkedin_Icon.png" alt="description" />
      </footer>
    </div>
  );
}
